monxin_sql_startDROP TABLE IF EXISTS `monxin_mall_agent_finance`;m;o;n;
CREATE TABLE `monxin_mall_agent_finance` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(2) NOT NULL DEFAULT '0' COMMENT '类型',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '时间',
  `money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `before_money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '操作前金额',
  `after_money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '操作后金额',
  `operator` varchar(30) DEFAULT NULL COMMENT '操作者',
  `reason` text COMMENT '操作原因',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `shop_name` varchar(100) DEFAULT NULL COMMENT '店铺名称',
  `username` varchar(30) NOT NULL COMMENT '用户名',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='平台招商员财务日志';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_bank_transfer`;m;o;n;
CREATE TABLE `monxin_mall_bank_transfer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单ID',
  `pay_photo` varchar(55) DEFAULT NULL COMMENT '支付凭证图片',
  `pay_info` varchar(100) DEFAULT NULL COMMENT '支付信息',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '提交时间',
  `buyer` varchar(30) NOT NULL COMMENT '支付人',
  PRIMARY KEY (`id`),
  KEY `buyer` (`buyer`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='订单 线下支付记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_bidding`;m;o;n;
CREATE TABLE `monxin_mall_bidding` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL COMMENT '店铺ID',
  `gid` int(11) NOT NULL COMMENT '商品ID',
  `time` bigint(12) NOT NULL COMMENT '时间',
  `src_title` varchar(30) DEFAULT NULL COMMENT '来源页面标题',
  `src_url` varchar(50) DEFAULT NULL COMMENT '来源网址',
  `username` varchar(30) DEFAULT NULL COMMENT '点击人',
  `money` decimal(5,2) NOT NULL DEFAULT '0.00' COMMENT '点击扣费',
  `ip` varchar(40) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`),
  KEY `username` (`username`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='商品竟价排名消费记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_brand`;m;o;n;
CREATE TABLE `monxin_mall_brand` (
  `id` int(3) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  `parent` int(3) NOT NULL DEFAULT '0',
  `sequence` int(3) NOT NULL DEFAULT '0',
  `visible` int(1) NOT NULL DEFAULT '1',
  `url` varchar(200) DEFAULT NULL COMMENT '链接网址',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=54 DEFAULT CHARSET=utf8 COMMENT='品牌模块数据';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_buy_coupon`;m;o;n;
CREATE TABLE `monxin_mall_buy_coupon` (
  `id` int(3) NOT NULL AUTO_INCREMENT,
  `sum_quantity` int(10) NOT NULL DEFAULT '1' COMMENT '购物券总数量',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `time` bigint(12) NOT NULL DEFAULT '0',
  `name` varchar(300) DEFAULT NULL COMMENT '购物名称',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '购物金额',
  `min_money` decimal(10,2) NOT NULL DEFAULT '100.00' COMMENT '最小订单金额',
  `start_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '使用开始时间',
  `end_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '使用结束时间',
  `username` varchar(30) DEFAULT NULL COMMENT '操作人',
  `use_quantity` int(10) NOT NULL DEFAULT '0' COMMENT '购物券已用数量',
  `join_goods` int(11) NOT NULL DEFAULT '1' COMMENT '参加商品 1全店 0促销商品',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=34 DEFAULT CHARSET=utf8 COMMENT='店铺单次购物券';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_buy_coupon_list`;m;o;n;
CREATE TABLE `monxin_mall_buy_coupon_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(8) DEFAULT NULL COMMENT '密码',
  `buyer` varchar(30) DEFAULT NULL COMMENT '使用人',
  `use_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '使用时间',
  `coupon_id` int(11) NOT NULL DEFAULT '0' COMMENT '批次ID',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单ID',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `buyer` (`buyer`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=68274 DEFAULT CHARSET=utf8 COMMENT='店铺单次购物券 详情';m;o;n;
