CREATE TABLE `monxin_mall_cart` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(30) DEFAULT NULL,
  `key` varchar(30) NOT NULL COMMENT '商品key',
  `quantity` decimal(10,3) NOT NULL DEFAULT '0.000' COMMENT '数量',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '价格',
  `time` int(12) NOT NULL DEFAULT '0' COMMENT '时间',
  PRIMARY KEY (`id`),
  KEY `username` (`username`),
  KEY `key` (`key`)
) ENGINE=MyISAM AUTO_INCREMENT=24 DEFAULT CHARSET=utf8 COMMENT='购物车';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_checkout`;m;o;n;
CREATE TABLE `monxin_mall_checkout` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods` text COMMENT '商品数据(json格式)',
  `username` varchar(30) NOT NULL COMMENT '买家用户名',
  `money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '订单金额',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '时间',
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '支付状态 参考本语言数组qr_state',
  `pay_method` varchar(10) DEFAULT NULL COMMENT '支付方式',
  PRIMARY KEY (`id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='店铺收银台，余额支付临时数据';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_color`;m;o;n;
CREATE TABLE `monxin_mall_color` (
  `id` int(3) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL,
  `sequence` int(3) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='商品颜色选项';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_comment`;m;o;n;
CREATE TABLE `monxin_mall_comment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `order_id` int(11) NOT NULL DEFAULT '0',
  `goods_id` int(11) NOT NULL DEFAULT '0',
  `buyer` varchar(30) DEFAULT NULL COMMENT '评论人',
  `content` varchar(500) DEFAULT NULL COMMENT '评论内容',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '评论时间',
  `level` int(1) NOT NULL DEFAULT '0' COMMENT '评论级别',
  `answer` varchar(300) DEFAULT NULL COMMENT '回复内容',
  `answer_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '回复时间',
  `seller` varchar(30) NOT NULL COMMENT '卖家',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`),
  KEY `goods_id` (`goods_id`),
  KEY `buyer` (`buyer`),
  KEY `seller` (`seller`)
) ENGINE=MyISAM AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='商品评论';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_coupon`;m;o;n;
CREATE TABLE `monxin_mall_coupon` (
  `id` int(3) NOT NULL AUTO_INCREMENT,
  `sum_quantity` int(10) NOT NULL DEFAULT '1' COMMENT '总数量',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `time` bigint(12) NOT NULL DEFAULT '0',
  `name` varchar(300) DEFAULT NULL COMMENT '名称',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `min_money` decimal(10,2) NOT NULL DEFAULT '100.00' COMMENT '最小订单金额',
  `start_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '使用开始时间',
  `end_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '使用结束时间',
  `username` varchar(30) DEFAULT NULL COMMENT '操作人',
  `open` varchar(10) DEFAULT NULL COMMENT '是否公开领取',
  `used` int(10) NOT NULL DEFAULT '0' COMMENT '已用数量',
  `join_goods` int(11) NOT NULL DEFAULT '1' COMMENT '参加商品 1全店 0促销商品',
  `shop_name` varchar(100) DEFAULT NULL COMMENT '店名',
  `draws` int(11) NOT NULL DEFAULT '0' COMMENT '已领取',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='店内红包';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_create_card`;m;o;n;
CREATE TABLE `monxin_mall_create_card` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(30) DEFAULT NULL,
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '参考本语言数组card_state',
  `money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '默认余额',
  `password` varchar(10) DEFAULT NULL COMMENT '登录密码',
  `transaction_password` varchar(10) DEFAULT NULL COMMENT '支付密码',
  `batch_id` int(11) NOT NULL DEFAULT '0' COMMENT '批次ID',
  `chip` int(11) NOT NULL DEFAULT '0' COMMENT '芯片号码',
  `use_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '首次使用时间',
  PRIMARY KEY (`id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=55 DEFAULT CHARSET=utf8 COMMENT='批开新购物卡记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_create_card_batch`;m;o;n;
CREATE TABLE `monxin_mall_create_card_batch` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) DEFAULT NULL,
  `time` bigint(12) NOT NULL DEFAULT '0',
  `quantity` int(11) NOT NULL DEFAULT '0' COMMENT '数量',
  `used` int(11) NOT NULL COMMENT '已使用',
  `money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '初始化余额',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='批开新购物卡批次';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_discount`;m;o;n;
CREATE TABLE `monxin_mall_discount` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `rate` decimal(3,1) NOT NULL DEFAULT '10.0' COMMENT '折扣百分比',
  `start_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '起始时间',
  `end_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '结束时间',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `username` varchar(30) DEFAULT NULL,
  `join_goods` int(1) NOT NULL DEFAULT '0' COMMENT '参加商品 1全店 0促销商品',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='店铺限时打折';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_diypage`;m;o;n;
CREATE TABLE `monxin_mall_diypage` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) NOT NULL COMMENT '网页标题',
  `content` text COMMENT '内容',
  `phone_content` text COMMENT '手机专版内容',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属店铺ID',
  `visible` int(1) NOT NULL DEFAULT '1' COMMENT '是否显示',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '最后编辑时间',
  `visit` int(11) NOT NULL DEFAULT '0' COMMENT '访问量',
  `creater` varchar(10) DEFAULT NULL COMMENT '创建者',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=24 DEFAULT CHARSET=utf8 COMMENT='店铺自定义网页';m;o;n;
