DROP TABLE IF EXISTS `monxin_mall_express`;m;o;n;
CREATE TABLE `monxin_mall_express` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `time` int(12) NOT NULL DEFAULT '0' COMMENT '最后修改时间',
  `name` varchar(100) DEFAULT NULL COMMENT '快递公司名称',
  `first_weight` int(11) NOT NULL DEFAULT '1000' COMMENT '首重重量',
  `over_weight` int(11) NOT NULL COMMENT '续重重量',
  `sequence` int(3) NOT NULL DEFAULT '0',
  `url` varchar(300) DEFAULT NULL COMMENT '查询网址',
  `first_price` decimal(6,2) NOT NULL DEFAULT '10.00' COMMENT '起重价格',
  `over_price` decimal(6,2) NOT NULL DEFAULT '5.00' COMMENT '续重价格',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COMMENT='快递公司';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_express_consignor`;m;o;n;
CREATE TABLE `monxin_mall_express_consignor` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `shipper_name` varchar(30) DEFAULT NULL COMMENT '寄件人姓名',
  `shipper_tel` varchar(30) DEFAULT NULL COMMENT '寄件人电话',
  `shipper_phone` varchar(30) DEFAULT NULL COMMENT '寄件人手机',
  `shipper_company` varchar(30) DEFAULT NULL COMMENT '寄件人单位名称',
  `shipper_address` varchar(100) DEFAULT NULL COMMENT '寄件人地址',
  `shipper_city` varchar(30) DEFAULT NULL COMMENT '寄件人始发城市',
  `shipper_postcode` varchar(30) DEFAULT NULL COMMENT '寄件人邮编',
  `shipper_signature` varchar(30) DEFAULT NULL COMMENT '寄件人签名',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='发货地址设置';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_express_layout`;m;o;n;
CREATE TABLE `monxin_mall_express_layout` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `e_id` int(11) NOT NULL DEFAULT '0',
  `shipper_name` text COMMENT '寄件人姓名',
  `shipper_tel` text COMMENT '寄件人电话',
  `shipper_phone` text COMMENT '寄件人手机',
  `shipper_company` text COMMENT '寄件人单位名称',
  `shipper_address` text COMMENT '寄件人地址',
  `shipper_city` text COMMENT '寄件人始发城市',
  `shipper_postcode` text COMMENT '寄件人邮编',
  `shipper_signature` text COMMENT '寄件人签名',
  `shipper_time` text COMMENT '寄件日期',
  `shipper_remark` text COMMENT '寄件人备注',
  `consignee_name` text COMMENT '收件人姓名',
  `consignee_tel` text COMMENT '收件人电话',
  `consignee_phone` text COMMENT '收件人手机',
  `consignee_company` text COMMENT '收件人单位名称',
  `consignee_address` text COMMENT '收件人地址',
  `consignee_city` text COMMENT '目的城市',
  `consignee_postcode` text COMMENT '收件人邮编',
  `width` int(4) NOT NULL DEFAULT '230' COMMENT '单据宽(mm)',
  `height` int(4) NOT NULL DEFAULT '127' COMMENT '单据高(mm)',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='快递单打印设置 css';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_express_price`;m;o;n;
CREATE TABLE `monxin_mall_express_price` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `express_id` int(11) NOT NULL DEFAULT '0',
  `area_id` int(11) NOT NULL DEFAULT '0',
  `first_price` decimal(5,2) NOT NULL DEFAULT '10.00' COMMENT '首重价格',
  `continue_price` decimal(5,2) NOT NULL DEFAULT '8.00' COMMENT '续重价格',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='快递价格设置';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_favorite`;m;o;n;
CREATE TABLE `monxin_mall_favorite` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(30) DEFAULT NULL,
  `goods_id` int(11) NOT NULL DEFAULT '0',
  `time` bigint(12) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `username` (`username`),
  KEY `goods_id` (`goods_id`)
) ENGINE=MyISAM AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COMMENT='买家收藏商品';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_finance`;m;o;n;
CREATE TABLE `monxin_mall_finance` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(1) NOT NULL DEFAULT '0' COMMENT '类型',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '时间',
  `money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `before_money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '操作前金额',
  `after_money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '操作后金额',
  `operator` varchar(30) DEFAULT NULL COMMENT '操作者',
  `reason` text COMMENT '操作原因',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `shop_name` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=27 DEFAULT CHARSET=utf8 COMMENT='商城财务记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_free_shipping`;m;o;n;
CREATE TABLE `monxin_mall_free_shipping` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `area_ids` text,
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='包邮地区';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_fulfil_preferential`;m;o;n;
CREATE TABLE `monxin_mall_fulfil_preferential` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `start_time` bigint(12) NOT NULL DEFAULT '0',
  `end_time` bigint(12) NOT NULL DEFAULT '0',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `use_method` int(1) NOT NULL DEFAULT '0' COMMENT '优惠方式',
  `discount` decimal(3,1) NOT NULL DEFAULT '10.0' COMMENT '打折',
  `less_money` int(11) NOT NULL DEFAULT '0' COMMENT '减钱',
  `min_money` int(11) NOT NULL DEFAULT '0' COMMENT '达到额度',
  `username` varchar(30) DEFAULT NULL,
  `join_goods` int(1) NOT NULL DEFAULT '1' COMMENT '参加商品 1全店 0促销商品 2不参加促销的商品',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='店铺满元优惠设置';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_goods`;m;o;n;
CREATE TABLE `monxin_mall_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属店铺ID',
  `virtual_auto_delivery` varchar(1000) DEFAULT NULL COMMENT '虚拟物品自动发货',
  `min_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '最低价(主用于有规格商品)',
  `max_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '最高价(主用于有规格商品)',
  `state` int(1) NOT NULL DEFAULT '1' COMMENT '商品状态 参考本语言数组goods_state',
  `type` int(3) NOT NULL DEFAULT '0' COMMENT '分类',
  `tag` text COMMENT '标签',
  `brand` int(3) NOT NULL DEFAULT '0' COMMENT '品牌',
  `unit` int(3) NOT NULL COMMENT '计量单位',
  `bar_code` varchar(13) NOT NULL DEFAULT '0' COMMENT '条码',
  `speci_bar_code` text COMMENT '规格条码集',
  `logistics_weight` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT '物流重量',
  `logistics_volume` decimal(22,2) NOT NULL DEFAULT '0.00' COMMENT '物流体积',
  `free_shipping` int(1) NOT NULL DEFAULT '0' COMMENT '包邮',
  `w_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '网上售价',
  `e_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '实体店售价',
  `cost_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '成本价(已弃用)',
  `inventory` decimal(14,3) NOT NULL DEFAULT '0.000' COMMENT '库存',
  `position` int(3) NOT NULL DEFAULT '0' COMMENT '货位',
  `supplier` int(3) NOT NULL COMMENT '商品供应商',
  `title` varchar(100) DEFAULT NULL COMMENT '标题',
  `advantage` varchar(100) DEFAULT NULL COMMENT '卖点',
  `icon` varchar(55) DEFAULT NULL COMMENT '封面图片',
  `multi_angle_img` text COMMENT '多视角图片',
  `detail` text COMMENT '详情',
  `m_detail` text COMMENT '手机版商品详情',
  `visit` int(11) NOT NULL DEFAULT '0' COMMENT '访问量',
  `sold` int(11) NOT NULL DEFAULT '0' COMMENT '销量',
  `sequence` int(5) NOT NULL DEFAULT '0' COMMENT '排序',
  `sales_promotion` int(1) NOT NULL DEFAULT '1' COMMENT '是否参加促销活动',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '最后编辑时间',
  `username` varchar(30) DEFAULT NULL COMMENT '最后编辑人',
  `option_enable` int(1) NOT NULL DEFAULT '0' COMMENT '是否有规格',
  `relevance_goods` varchar(240) DEFAULT NULL COMMENT '关联商品',
  `relevance_package` varchar(55) DEFAULT NULL COMMENT '关联套餐',
  `monthly` int(11) NOT NULL DEFAULT '0' COMMENT '月销售量',
  `discount` decimal(3,1) NOT NULL DEFAULT '10.0' COMMENT '折扣',
  `discount_start_time` int(12) NOT NULL DEFAULT '0' COMMENT '折扣起始时间',
  `discount_end_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '折扣结束时间',
  `comment_0` int(6) NOT NULL DEFAULT '0' COMMENT '好评',
  `comment_1` int(6) NOT NULL DEFAULT '0' COMMENT '中评',
  `comment_2` int(6) NOT NULL DEFAULT '0' COMMENT '差评',
  `satisfaction` int(3) NOT NULL DEFAULT '100' COMMENT '满意度',
  `shelf_life` int(11) NOT NULL DEFAULT '0' COMMENT '保质期(天)',
  `shop_type` int(11) NOT NULL DEFAULT '0' COMMENT '店内分类',
  `shop_tag` text COMMENT '店内标签',
  `shop_sequence` int(5) NOT NULL DEFAULT '0' COMMENT '店内排序',
  `return` int(1) NOT NULL DEFAULT '1' COMMENT '支持无由理退货',
  `bidding_show` decimal(5,2) NOT NULL DEFAULT '0.00' COMMENT '竟价排名',
  `deposit` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '店铺保证金',
  `pre_discount` decimal(4,2) NOT NULL DEFAULT '10.00' COMMENT '预售折扣',
  `out_delivered` bigint(12) NOT NULL DEFAULT '0' COMMENT '缺货预售 发货时间',
  `limit` int(3) NOT NULL DEFAULT '0' COMMENT '每人限购数量',
  `limit_cycle` varchar(1) NOT NULL COMMENT '限购时长',
  `recommendation` int(1) NOT NULL DEFAULT '0' COMMENT '是否支持推荐',
  `recommendation_slogan` varchar(150) DEFAULT NULL COMMENT '推荐码广告语',
  `agency` int(1) NOT NULL DEFAULT '0' COMMENT '是否支持分销',
  `agency_state` int(1) NOT NULL DEFAULT '0' COMMENT '分销状态',
