DROP TABLE IF EXISTS `monxin_mall_goods_attribute`;m;o;n;
CREATE TABLE `monxin_mall_goods_attribute` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `attribute_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属属性ID',
  `value` text COMMENT '值',
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属商品ID',
  `sequence` int(3) NOT NULL DEFAULT '0' COMMENT '排序',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '所属分类ID',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='商品属性';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_goods_batch`;m;o;n;
CREATE TABLE `monxin_mall_goods_batch` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` varchar(30) DEFAULT NULL COMMENT '商品ID',
  `quantity` decimal(14,3) NOT NULL DEFAULT '0.000' COMMENT '商品数量',
  `price` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '进货价',
  `add_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '进货时间',
  `sell_out_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '售完时间',
  `left` decimal(14,3) NOT NULL DEFAULT '0.000' COMMENT '剩余',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `supplier` int(11) NOT NULL DEFAULT '0' COMMENT '供应商',
  `expiration` bigint(12) NOT NULL DEFAULT '0' COMMENT '过期时间',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=204 DEFAULT CHARSET=utf8 COMMENT='商品入库记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_goods_contain`;m;o;n;
CREATE TABLE `monxin_mall_goods_contain` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `name` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='商品货架显示规格写入记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_goods_deduct_stock`;m;o;n;
CREATE TABLE `monxin_mall_goods_deduct_stock` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属商品ID',
  `quantity` decimal(6,2) NOT NULL DEFAULT '0.00' COMMENT '数量',
  `money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '商品金额',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '时间',
  `username` varchar(30) DEFAULT NULL COMMENT '操作员',
  `reason` varchar(100) DEFAULT NULL COMMENT '出库原因',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属店铺ID',
  `s_id` int(11) NOT NULL DEFAULT '0' COMMENT '型号ID',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `username` (`username`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 COMMENT='商品出库记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_goods_grade`;m;o;n;
CREATE TABLE `monxin_mall_goods_grade` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `name` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='商品等级写入记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_goods_group_discount`;m;o;n;
CREATE TABLE `monxin_mall_goods_group_discount` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `group_id` int(11) NOT NULL DEFAULT '0' COMMENT '店内买家用户组ID',
  `discount` decimal(18,16) NOT NULL DEFAULT '10.0000000000000000' COMMENT '商品折扣',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=MyISAM AUTO_INCREMENT=82 DEFAULT CHARSET=utf8 COMMENT='店内会员按等级打折';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_goods_habitat`;m;o;n;
CREATE TABLE `monxin_mall_goods_habitat` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `name` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='商品产地写入记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_goods_loss`;m;o;n;
CREATE TABLE `monxin_mall_goods_loss` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `quantity` decimal(6,2) NOT NULL DEFAULT '0.00' COMMENT '数量',
  `money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '商品金额',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '时间',
  `username` varchar(30) DEFAULT NULL COMMENT '操作员',
  `reason` varchar(100) DEFAULT NULL COMMENT '原因',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属店铺ID',
  `s_id` int(11) NOT NULL DEFAULT '0' COMMENT '型号ID',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `username` (`username`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=47 DEFAULT CHARSET=utf8 COMMENT='商品报损';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_goods_quantity_log`;m;o;n;
CREATE TABLE `monxin_mall_goods_quantity_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `quantity` decimal(14,3) NOT NULL DEFAULT '0.000' COMMENT '数量',
  `username` varchar(30) DEFAULT NULL COMMENT '购买人',
  `time` bigint(12) NOT NULL DEFAULT '0',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单ID',
  `batch_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品批次',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `in_price` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '进货价',
  `out_price` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '销售价',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `username` (`username`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=311 DEFAULT CHARSET=utf8 COMMENT='商品销售记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_goods_snapshot`;m;o;n;
CREATE TABLE `monxin_mall_goods_snapshot` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) NOT NULL,
  `title` varchar(100) DEFAULT NULL COMMENT '标题',
  `advantage` varchar(100) DEFAULT NULL,
