  `multi_angle_img` text COMMENT '多视角图片',
  `detail` text COMMENT '详情',
  `m_detail` text COMMENT '手机版',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '生成时间',
  `attribute` text COMMENT '属性',
  PRIMARY KEY (`id`),
  KEY `id` (`id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=MyISAM AUTO_INCREMENT=54 DEFAULT CHARSET=utf8 COMMENT='商品快照';m;o;n;
