DROP TABLE IF EXISTS `monxin_mall_goods_specifications`;m;o;n;
CREATE TABLE `monxin_mall_goods_specifications` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `color_id` int(11) NOT NULL DEFAULT '0',
  `color_name` varchar(30) DEFAULT NULL,
  `color_show` int(1) NOT NULL DEFAULT '0' COMMENT '显示图片或文字',
  `color_img` varchar(55) DEFAULT NULL,
  `option_id` int(11) DEFAULT '0',
  `goods_id` int(11) NOT NULL DEFAULT '0',
  `sequence` int(3) NOT NULL DEFAULT '0',
  `e_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '实体店售价',
  `w_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '网店售价',
  `cost_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '成本价(已弃用)',
  `quantity` decimal(14,3) NOT NULL DEFAULT '0.000' COMMENT '数量',
  `barcode` varchar(13) NOT NULL DEFAULT '0' COMMENT '条形码',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '所属分类',
  `store_code` varchar(15) DEFAULT NULL COMMENT '店内编码',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`),
  KEY `barcode` (`barcode`),
  KEY `store_code` (`store_code`)
) ENGINE=MyISAM AUTO_INCREMENT=144 DEFAULT CHARSET=utf8 COMMENT='商品规格';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_group_set`;m;o;n;
CREATE TABLE `monxin_mall_group_set` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `group_id` int(5) NOT NULL COMMENT '用户组ID',
  `credits` decimal(4,2) NOT NULL DEFAULT '1.00' COMMENT '购物赠送积分比列',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='商城用户组好处设置';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_headquarters`;m;o;n;
CREATE TABLE `monxin_mall_headquarters` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) DEFAULT NULL COMMENT '总部名称',
  `goods_sum` int(11) NOT NULL DEFAULT '0' COMMENT '累计商品',
  `branch_sum` int(11) NOT NULL DEFAULT '0' COMMENT '累计分店',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '时间',
  `username` varchar(30) DEFAULT NULL COMMENT '操作员',
  PRIMARY KEY (`id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='连锁总部';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_interest_group`;m;o;n;
CREATE TABLE `monxin_mall_interest_group` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL COMMENT '兴趣组名称',
  `sequence` int(3) NOT NULL DEFAULT '0' COMMENT '排序',
  `words` int(3) NOT NULL DEFAULT '0' COMMENT '包括关键词数量',
  `day` int(7) NOT NULL DEFAULT '0' COMMENT '当日用户量',
  `week` int(8) NOT NULL DEFAULT '0' COMMENT '本周用户量',
  `month` int(9) NOT NULL DEFAULT '0' COMMENT '月用户量',
  `year` int(10) NOT NULL DEFAULT '0' COMMENT '年用户量',
  `sum` int(11) NOT NULL DEFAULT '0' COMMENT '累计用户量',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COMMENT='兴趣组';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_interest_group_user`;m;o;n;
CREATE TABLE `monxin_mall_interest_group_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `group_id` int(11) NOT NULL DEFAULT '0' COMMENT '兴趣组ID',
  `username` varchar(30) NOT NULL COMMENT '用户名',
  `frequency` int(10) NOT NULL DEFAULT '0' COMMENT '累计访问次数',
  `duration` int(11) NOT NULL DEFAULT '0' COMMENT '累计访问时间',
  `last_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '最后访问时间',
  PRIMARY KEY (`id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 COMMENT='兴趣组用户';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_interest_word`;m;o;n;
CREATE TABLE `monxin_mall_interest_word` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL COMMENT '兴趣词名称',
  `group_ids` text COMMENT '兴趣词所属分组ID',
  `day` int(7) NOT NULL DEFAULT '0' COMMENT '当天用户量',
  `week` int(8) NOT NULL DEFAULT '0' COMMENT '本周用户量',
  `month` int(9) NOT NULL DEFAULT '0' COMMENT '本月用户量',
  `year` int(10) NOT NULL DEFAULT '0' COMMENT '年用户量',
  `sum` int(11) NOT NULL DEFAULT '0' COMMENT '累计用户量',
  `type_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属分类ID',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1381 DEFAULT CHARSET=utf8 COMMENT='兴趣词';m;o;n;
