CREATE TABLE `monxin_mall_interest_word_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `word_id` varchar(30) NOT NULL COMMENT '兴趣词id',
  `username` varchar(30) NOT NULL COMMENT '用户名',
