CREATE TABLE `monxin_mall_invoice` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) DEFAULT NULL,
  `sequence` int(3) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='下单发票选项';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_menu`;m;o;n;
CREATE TABLE `monxin_mall_menu` (
  `id` int(3) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL,
  `url` varchar(300) NOT NULL,
  `sequence` int(3) NOT NULL DEFAULT '0',
  `parent_id` int(3) NOT NULL DEFAULT '0',
  `open_target` varchar(10) NOT NULL,
  `visible` int(1) NOT NULL DEFAULT '1',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='店铺手机版底部菜单（已停用）';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_module`;m;o;n;
CREATE TABLE `monxin_mall_module` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) NOT NULL COMMENT '模块标题',
  `title_visible` int(1) NOT NULL DEFAULT '0' COMMENT '标题是否显示',
  `content` text COMMENT '内容',
  `width` varchar(6) DEFAULT NULL COMMENT '宽度',
  `sequence` int(5) NOT NULL DEFAULT '0' COMMENT '排序',
  `height` varchar(6) DEFAULT NULL COMMENT '高度',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属店铺ID',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '最后编辑时间',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='店铺自定义模块';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_my_coupon`;m;o;n;
CREATE TABLE `monxin_mall_my_coupon` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `coupon_id` int(11) NOT NULL DEFAULT '0',
  `username` varchar(30) NOT NULL,
  `draws_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '领取时间',
  `use_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '使用时间',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '使用订单ID',
  PRIMARY KEY (`id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=41 DEFAULT CHARSET=utf8 COMMENT='我领到的店内红包';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_navigation`;m;o;n;
CREATE TABLE `monxin_mall_navigation` (
  `id` int(3) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL COMMENT '名称',
  `url` varchar(300) NOT NULL COMMENT '链接',
  `sequence` int(3) NOT NULL DEFAULT '0' COMMENT '排序',
  `parent_id` int(3) NOT NULL DEFAULT '0' COMMENT '父级ID',
  `open_target` varchar(10) NOT NULL COMMENT '打开方式',
  `visible` int(1) NOT NULL DEFAULT '1' COMMENT '是否显示',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属店铺ID',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=46 DEFAULT CHARSET=utf8 COMMENT='店铺导航条数据';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_order`;m;o;n;
CREATE TABLE `monxin_mall_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `receiver_area_name` varchar(100) DEFAULT NULL COMMENT '收货人所在地名称',
  `last_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '最后操作时间',
  `goods_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品金额',
  `actual_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '实付金额',
  `change_price_reason` varchar(300) DEFAULT NULL COMMENT '改价理由',
  `pay_method` varchar(20) DEFAULT NULL COMMENT '付款方式',
  `cashier` varchar(30) DEFAULT NULL COMMENT '收银员',
  `buyer` varchar(30) DEFAULT NULL COMMENT '买家',
  `add_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '下单时间',
  `received_money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '收到金额',
  `change` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '找赎',
  `state` int(2) NOT NULL DEFAULT '0' COMMENT '订单状态 参考本语言数组order_state',
  `preferential_way` int(1) NOT NULL DEFAULT '0' COMMENT '优惠方式',
  `delivery_time` int(1) NOT NULL DEFAULT '0' COMMENT '送货时间',
  `invoice` varchar(10) DEFAULT NULL COMMENT '发票信息',
  `buyer_remark` text COMMENT '买家备注',
  `seller_remark` text COMMENT '卖家备注',
  `express` int(5) NOT NULL DEFAULT '0' COMMENT '快递公司',
  `express_code` varchar(50) DEFAULT NULL COMMENT '运单号',
  `preferential_code` varchar(50) DEFAULT NULL COMMENT '优惠代码',
  `receiver_id` int(11) NOT NULL DEFAULT '0' COMMENT '收货信息id',
  `weight` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品总重量',
  `express_cost_buyer` decimal(5,2) NOT NULL DEFAULT '0.00' COMMENT '买家运费',
  `express_cost_seller` decimal(5,2) NOT NULL DEFAULT '0.00' COMMENT '卖家运费',
  `sum_money` decimal(10,2) NOT NULL COMMENT '总付金额',
  `receiver_name` varchar(30) DEFAULT NULL COMMENT '收货人姓名',
  `receiver_phone` varchar(50) DEFAULT NULL COMMENT '收货人手机号',
  `receiver_area_id` int(11) NOT NULL DEFAULT '0' COMMENT '收货人所在地区',
  `receiver_detail` varchar(200) DEFAULT NULL COMMENT '收货人详细地址',
  `receiver_post_code` int(6) NOT NULL DEFAULT '0' COMMENT '收货人邮编',
  `goods_names` text COMMENT '所有商品名称',
  `auto_print` int(1) NOT NULL DEFAULT '0' COMMENT '已自动打印',
  `settlement_state` int(1) NOT NULL DEFAULT '0' COMMENT '结算状态',
  `cancel_reason` varchar(100) DEFAULT NULL COMMENT '订单取消原因',
  `refund_reason` varchar(100) DEFAULT NULL COMMENT '退款原因',
  `refund_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '退款金额',
  `refund_remark` text COMMENT '退货备注',
  `buyer_del` int(1) NOT NULL DEFAULT '0' COMMENT '买家删除',
  `seller_del` int(1) NOT NULL DEFAULT '0' COMMENT '卖家删除',
  `refund_voucher` varchar(60) DEFAULT NULL COMMENT '退货凭证图片',
  `express_voucher` varchar(60) DEFAULT NULL COMMENT '退货物流凭证',
  `receipt` int(1) NOT NULL DEFAULT '0' COMMENT '买家已收货',
  `send_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '卖家发货时间',
  `receipt_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '买家收到货的时间',
  `share` varchar(30) DEFAULT NULL COMMENT '分享人',
  `goods_cost` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '商品成本',
  `check_code` varchar(6) DEFAULT NULL COMMENT '核销码',
  `goods_count` decimal(13,3) NOT NULL DEFAULT '0.000' COMMENT '商品件数',
  `inventory_decrease` int(1) NOT NULL DEFAULT '0' COMMENT '已减库存',
  `shop_credits` int(11) NOT NULL DEFAULT '0' COMMENT '使用店内积分',
  `web_credits` int(11) NOT NULL DEFAULT '0' COMMENT '使用平台积分',
  `shop_credits_money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '积分抵扣金额',
  `web_credits_money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '积分抵扣金额',
  `credits_remark` varchar(50) DEFAULT NULL COMMENT '积分抵扣备注',
  `pre_sale` int(1) NOT NULL DEFAULT '0' COMMENT '是否预售',
  `receiving_extension` int(2) NOT NULL DEFAULT '0' COMMENT '收货延期天数',
  `reference_number` varchar(32) DEFAULT NULL COMMENT 'POS刷卡小票参考号',
  `introducer` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '会员注册推荐人收益',
  `out_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '订单外部编号',
  `credit_state` int(1) NOT NULL DEFAULT '0' COMMENT '赊账还款状态',
  `pay_method_remark` varchar(10) DEFAULT NULL COMMENT '在线支付子类别 微信或支付宝',
  `check_code_state` int(1) NOT NULL DEFAULT '0' COMMENT '核销码使用状态 0无需核销 1待使用 2已使用',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`),
  KEY `buyer` (`buyer`),
  KEY `out_id` (`out_id`)
) ENGINE=MyISAM AUTO_INCREMENT=235 DEFAULT CHARSET=utf8 COMMENT='订单';m;o;n;
