DROP TABLE IF EXISTS `monxin_mall_order_goods`;m;o;n;
CREATE TABLE `monxin_mall_order_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `buyer` varchar(30) DEFAULT NULL COMMENT '买家',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单ID',
  `order_state` int(2) NOT NULL DEFAULT '0' COMMENT '订单状态 参考本语言数组order_state',
  `icon` varchar(55) DEFAULT NULL COMMENT '商品封面图片',
  `title` varchar(120) DEFAULT NULL COMMENT '标题',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '价格',
  `transaction_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '交易价格',
  `s_id` int(11) NOT NULL DEFAULT '0' COMMENT '规格ID',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属铺店ID',
  `snapshot_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品快昭ID',
  `quantity` decimal(10,3) NOT NULL DEFAULT '1.000' COMMENT '数量',
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `unit` varchar(10) DEFAULT NULL COMMENT '商品单位',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '时间',
  `recommendation` int(1) NOT NULL DEFAULT '0' COMMENT '是否支持推荐',
  `refund` decimal(10,3) NOT NULL DEFAULT '0.000' COMMENT '已退数量',
  PRIMARY KEY (`id`),
  KEY `buyer` (`buyer`),
  KEY `shop_id` (`shop_id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=MyISAM AUTO_INCREMENT=330 DEFAULT CHARSET=utf8 COMMENT='订单商品';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_package`;m;o;n;
CREATE TABLE `monxin_mall_package` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `discount` decimal(4,2) NOT NULL DEFAULT '0.00' COMMENT '打折',
  `goods_ids` varchar(100) DEFAULT NULL,
  `free_shipping` int(1) NOT NULL DEFAULT '1' COMMENT '是否包邮',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='商品套餐';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_page`;m;o;n;
CREATE TABLE `monxin_mall_page` (
  `head` text COMMENT '头部模块',
  `left` text COMMENT '左则模块',
  `right` text COMMENT '右侧模块',
  `full` text COMMENT '满屏模块',
  `phone` text COMMENT '手机专用模块',
  `layout` varchar(10) NOT NULL DEFAULT 'right' COMMENT '主内容调用数据来源',
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `url` varchar(200) NOT NULL COMMENT '链接',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `bottom` text COMMENT '底部模块',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=105 DEFAULT CHARSET=utf8 COMMENT='店铺网页排版数据';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_position`;m;o;n;
CREATE TABLE `monxin_mall_position` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) DEFAULT NULL,
  `sequence` int(3) NOT NULL DEFAULT '0',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='店铺商品位置（仓库货架）';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_pre_sale`;m;o;n;
CREATE TABLE `monxin_mall_pre_sale` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) NOT NULL COMMENT '商品ID',
  `deposit` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订金',
  `reduction` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '抵用',
  `last_pay_start_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '尾款支付起始时间',
  `delivered` bigint(12) NOT NULL DEFAULT '0' COMMENT '发货时间',
  `last_pay_end_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '尾款支付结果时间',
  PRIMARY KEY (`id`),
  KEY `goods_id` (`goods_id`)
) ENGINE=MyISAM AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='商品预售设置';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_public_stock`;m;o;n;
CREATE TABLE `monxin_mall_public_stock` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `big` int(11) NOT NULL DEFAULT '0' COMMENT '大包装',
  `small` int(11) NOT NULL DEFAULT '0' COMMENT '小包装',
  `quantity` int(4) NOT NULL DEFAULT '0' COMMENT '大包装=N小包装',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8 COMMENT='共库存商品';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_receiver`;m;o;n;
CREATE TABLE `monxin_mall_receiver` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(30) DEFAULT NULL COMMENT '用户名',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '最后编辑时间',
  `area_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属地区ID',
  `detail` varchar(200) DEFAULT NULL COMMENT '详细地址',
  `post_code` int(6) NOT NULL DEFAULT '0' COMMENT '邮编',
  `name` varchar(30) DEFAULT NULL COMMENT '收件人姓名',
  `phone` varchar(50) DEFAULT NULL COMMENT '收件人手机',
  `sequence` int(3) NOT NULL DEFAULT '0' COMMENT '排序',
  `tag` varchar(100) DEFAULT NULL COMMENT '标签',
  PRIMARY KEY (`id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=60 DEFAULT CHARSET=utf8 COMMENT='买家收货地址';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_recommendation`;m;o;n;
CREATE TABLE `monxin_mall_recommendation` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) NOT NULL DEFAULT '0',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '返点时间',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `username` varchar(30) DEFAULT NULL COMMENT '推荐人',
  `money` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '返点金额',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='推荐码交易记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_refund`;m;o;n;
CREATE TABLE `monxin_mall_refund` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属店铺ID',
  `order_id` int(11) NOT NULL DEFAULT '0' COMMENT '订单ID',
  `out_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '所属订单ID',
  `goods_id` int(11) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `s_id` int(11) NOT NULL DEFAULT '0' COMMENT '规格ID',
  `quantity` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '退货数量',
  `username` varchar(30) DEFAULT NULL COMMENT '退货操作员',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '退货时间',
  `reason` varchar(100) DEFAULT NULL COMMENT '原因',
  `buyer` varchar(30) DEFAULT NULL COMMENT '买家',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COMMENT='线下退货记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_search_log`;m;o;n;
CREATE TABLE `monxin_mall_search_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `keyword` varchar(30) NOT NULL COMMENT '关键词',
  `day` int(11) NOT NULL DEFAULT '1' COMMENT '当日搜索量',
  `week` int(11) NOT NULL DEFAULT '1' COMMENT '本周搜索量',
  `month` int(11) NOT NULL DEFAULT '1' COMMENT '本月搜索量',
  `year` int(11) NOT NULL DEFAULT '1' COMMENT '本年搜索量',
  `sum` int(11) NOT NULL DEFAULT '1' COMMENT '累计搜索量',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=146 DEFAULT CHARSET=utf8 COMMENT='商城搜索记录';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_shop`;m;o;n;
CREATE TABLE `monxin_mall_shop` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(30) DEFAULT NULL COMMENT '店主用户名',
  `reg_username` varchar(30) DEFAULT NULL COMMENT '注册人用户名',
  `name` varchar(100) NOT NULL COMMENT '店名',
  `main_business` varchar(1000) DEFAULT NULL COMMENT '主营业务',
  `address` varchar(300) DEFAULT NULL COMMENT '地址',
  `run_type` int(1) NOT NULL DEFAULT '0' COMMENT '经营类型',
  `certificate_id` varchar(20) DEFAULT NULL COMMENT '证件号',
  `state` int(11) NOT NULL COMMENT '店铺状态 参考本语言数组shop_state',
  `position` varchar(30) DEFAULT NULL COMMENT '所在位置',
  `area` int(11) NOT NULL DEFAULT '0' COMMENT '所在区域',
  `self_certificate_id` varchar(20) DEFAULT NULL COMMENT '运营者身份证号码',
  `phone` varchar(11) DEFAULT NULL COMMENT '运营者手机',
  `email` varchar(100) DEFAULT NULL COMMENT '运营者邮箱',
  `goods` int(11) NOT NULL DEFAULT '0' COMMENT '商品统计',
  `order` int(11) NOT NULL DEFAULT '0' COMMENT '订单统计',
  `money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '营业额统计',
  `evaluation_0` int(11) NOT NULL DEFAULT '0' COMMENT '好评',
  `evaluation_1` int(11) NOT NULL DEFAULT '0' COMMENT '中评 ',
  `evaluation_2` int(11) NOT NULL DEFAULT '0' COMMENT '差评',
  `sequence` int(5) NOT NULL DEFAULT '0',
  `reg_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '申请时间',
  `last_time` bigint(12) NOT NULL DEFAULT '0' COMMENT '最后修改时间',
  `name_log` text COMMENT '店名修改日志',
  `head_pc` text COMMENT '电脑版 店铺头部',
  `head_phone` text COMMENT '手机版 店铺头部',
  `domain` varchar(100) DEFAULT NULL COMMENT '二级域名',
  `cashier` varchar(100) DEFAULT NULL COMMENT '收银员',
  `storekeeper` varchar(100) DEFAULT NULL COMMENT '仓库管理员',
  `foot_pc` text COMMENT '电脑版 店铺底部',
  `foot_phone` text COMMENT '手机版 店铺底部',
  `template` varchar(100) NOT NULL DEFAULT 'default' COMMENT '店铺模板',
  `pc_menu` text COMMENT '电脑版顶部菜单',
  `phone_menu` text COMMENT '手机版底部菜单',
  `phone_menu_show` int(1) NOT NULL DEFAULT '1' COMMENT '手机版底菜单是否显示',
  `express` text COMMENT '合作快递公司',
  `talk_type` int(3) NOT NULL DEFAULT '1' COMMENT '客服类型',
  `talk_account` varchar(100) DEFAULT NULL COMMENT '客服账号',
  `annual_fees` bigint(12) NOT NULL DEFAULT '0' COMMENT '年费期限',
  `trusteeship` int(1) NOT NULL DEFAULT '0' COMMENT '已托管',
  `agent` varchar(30) DEFAULT NULL COMMENT '招商员',
  `agent_pay` int(1) NOT NULL DEFAULT '0' COMMENT '已付招商员店铺入驻费',
  `deposit` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '保证金',
  `low_inventory` int(3) NOT NULL DEFAULT '10' COMMENT '低库存通知标准',
  `recommendation_discount` decimal(2,1) NOT NULL DEFAULT '9.0' COMMENT '推荐码优惠折扣',
  `recommendation_rebate` int(3) NOT NULL DEFAULT '10' COMMENT '推荐人返点',
  `is_head` int(1) NOT NULL DEFAULT '0' COMMENT '是否总部',
  `head` varchar(30) DEFAULT NULL COMMENT '总部名称',
  `use_goods_db` int(1) NOT NULL DEFAULT '0' COMMENT '使用商品数据',
  `expiration` int(3) NOT NULL DEFAULT '30' COMMENT '商品过期提前多少天通知',
  `qr_path` varchar(100) DEFAULT NULL COMMENT '二维码数据',
  `circle` int(11) NOT NULL DEFAULT '0' COMMENT '所属圈子',
  `tag` varchar(100) DEFAULT NULL COMMENT '店铺行业标签',
  `span_circle` int(1) NOT NULL DEFAULT '0' COMMENT '是否跨商圈店铺',
  `geohash` varchar(18) DEFAULT NULL COMMENT '编码后的经纬度',
  `barcode_repeat` int(1) NOT NULL DEFAULT '0' COMMENT '店内国际条码可重复',
  PRIMARY KEY (`id`),
  KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=93 DEFAULT CHARSET=utf8 COMMENT='店铺';m;o;n;
