DROP TABLE IF EXISTS `monxin_mall_shop_buyer`;m;o;n;
CREATE TABLE `monxin_mall_shop_buyer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(30) DEFAULT NULL COMMENT '买家用户名',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '首次购买时间',
  `money` decimal(22,2) NOT NULL DEFAULT '0.00' COMMENT '总计付款',
  `order` int(5) NOT NULL DEFAULT '0' COMMENT '订单统计',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `credits` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '当前积分',
  `cumulative_credits` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '累计积分',
  `group_id` int(11) NOT NULL DEFAULT '0' COMMENT '所属店内用户组',
  `chip` varchar(32) DEFAULT NULL COMMENT '会员卡卡号',
  `balance` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '店内余额',
  `repayment_remark` varchar(100) DEFAULT NULL COMMENT '赊账还款备注',
  PRIMARY KEY (`id`),
  KEY `username` (`username`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=75 DEFAULT CHARSET=utf8 COMMENT='店内会员';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_shop_buyer_balance`;m;o;n;
CREATE TABLE `monxin_mall_shop_buyer_balance` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(30) DEFAULT NULL COMMENT '用户名',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '时间',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `reason` varchar(100) DEFAULT NULL COMMENT '原因',
  PRIMARY KEY (`id`),
  KEY `username` (`username`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='店内余额日志';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_shop_buyer_credits`;m;o;n;
CREATE TABLE `monxin_mall_shop_buyer_credits` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(30) DEFAULT NULL COMMENT '用户名',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '店铺ID',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '时间',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `reason` varchar(100) DEFAULT NULL COMMENT '原因',
  PRIMARY KEY (`id`),
  KEY `username` (`username`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=91 DEFAULT CHARSET=utf8 COMMENT='店内积分日志';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_shop_buyer_group`;m;o;n;
CREATE TABLE `monxin_mall_shop_buyer_group` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL,
  `credits` int(11) NOT NULL DEFAULT '0' COMMENT '升级最低积分',
  `shop_id` int(11) NOT NULL,
  `discount` decimal(4,2) NOT NULL DEFAULT '10.00' COMMENT '折扣',
  `buy_credits_multiple` decimal(3,1) NOT NULL DEFAULT '1.0' COMMENT '购物赠送积分比例',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=53 DEFAULT CHARSET=utf8 COMMENT='店内会员等级';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_shop_finance`;m;o;n;
CREATE TABLE `monxin_mall_shop_finance` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(2) NOT NULL DEFAULT '0' COMMENT '类型',
  `time` bigint(12) NOT NULL DEFAULT '0' COMMENT '时间',
  `money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `before_money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '操作前金额',
  `after_money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '操作后金额',
  `operator` varchar(30) DEFAULT NULL COMMENT '操作者',
  `reason` text COMMENT '操作原因',
  `shop_id` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `shop_id` (`shop_id`)
) ENGINE=MyISAM AUTO_INCREMENT=336 DEFAULT CHARSET=utf8 COMMENT='店内财务日志';m;o;n;
DROP TABLE IF EXISTS `monxin_mall_shop_order_set`;m;o;n;
CREATE TABLE `monxin_mall_shop_order_set` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0',
  `decrease_quantity` int(1) NOT NULL DEFAULT '2' COMMENT '商品自动减库存',
  `order_notice_when` int(1) NOT NULL DEFAULT '0' COMMENT '订单通知',
  `order_notice_email` varchar(100) DEFAULT NULL COMMENT '通知邮箱(不填，则不通知)',
  `send_notice_email` int(1) NOT NULL DEFAULT '1' COMMENT '发货后邮件提醒买家',
  `send_notice_sms` int(1) NOT NULL DEFAULT '1' COMMENT '发货后短信提醒买家',
  `checkout_order_notice_email` int(1) NOT NULL DEFAULT '1' COMMENT '收银台交易提醒(邮件)',
  `checkout_order_notice_sms` int(1) NOT NULL DEFAULT '1' COMMENT '收银台交易提醒(短信)',
  `phone_goods_list_show_buy_button` int(1) NOT NULL DEFAULT '1' COMMENT '手机版商品列表显示购买按钮',
  `cash_on_delivery` int(1) NOT NULL DEFAULT '1' COMMENT '支持货到付款',
  `credit` int(1) NOT NULL DEFAULT '1' COMMENT '赊账',
  `pay_ad_fees` int(1) NOT NULL DEFAULT '0' COMMENT '愿意支付网友推广费',
  `pay_ad_fees_open_time` int(12) NOT NULL DEFAULT '0' COMMENT '推广费上次开启时间',
  `credits_rate` int(3) NOT NULL DEFAULT '100' COMMENT '多少店内积分=1元',
  `print_partner` varchar(32) DEFAULT NULL COMMENT '云打印 用户ID',
  `print_apikey` varchar(52) DEFAULT NULL COMMENT '云打印 API密钥',
  `print_machine_code` varchar(32) DEFAULT NULL COMMENT '云打印 终端号',
  `print_msign` varchar(32) DEFAULT NULL COMMENT '云打印 终端密钥',
  `print_supplier` varchar(32) DEFAULT NULL COMMENT '云打印机厂商',
  PRIMARY KEY (`id`),
